import { Formulario } from "./Elementos/Formulario";

const App = () => {
  return (
      <main>
        <Formulario action="">
          <label htmlFor="">Usuario</label>
        <input type="text" placeholder="usuario"/>
        <p>"tu mama es weona"</p>

        </Formulario>

      </main>
  );
}

export default App;
